export default function TestFetch({ date }) {

    const [data, setData] = useState(null);
    // initializing url
    const domain = 'https://openexchangerates.org/api/historical/';
    const endpoint = '.json?app_id=01341f5261444649a612793df73c7130';
    const url = `${domain}${date}${endpoint}`;


    useEffect(() => {
        setData(null);
        const url = `${domain}${date}${endpoint}`;
        const temp = UseFetchExchange(url);
        setData(temp);
    }, [date]);

    return (
        <>
            {data &&
                <p>{data.timestamp}</p>
            }
        </>
    )
}
